import React, { useState } from 'react';
import axios from 'axios';
import TextField from '@material-ui/core/TextField';

const ChartInput = () => {
  const [firstField, setFirstField] = useState('');
  const [secondField, setSecondField] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('/your-backend-api-url', {
        firstField,
        secondField,
      });

      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div style={{ border: '2px solid white', padding: '10px' }}>
      <form onSubmit={handleSubmit}>
        <TextField
          variant="outlined"
          label="Distribution Channel"
          value={firstField}
          onChange={(e) => setFirstField(e.target.value)}
          fullWidth
          style={{ marginBottom: '10px', backgroundColor: 'white' }}
        />
        <TextField
          variant="outlined"
          label="Customer Number"
          value={secondField}
          onChange={(e) => setSecondField(e.target.value)}
          fullWidth
          style={{ marginBottom: '10px', backgroundColor: 'white' }}
        />
        <div style={{ display: 'flex', justifyContent: 'center' }}>
          <button type="submit" style={{ backgroundColor: 'transparent', border: '1px solid white', color: 'white' }}>View</button>
        </div>
      </form>
    </div>
  );
};

export default ChartInput;
